import React from 'react';
import photo1 from '../../assets/experience/freelance-web-developer.jpg';
import photo2 from '../../assets/experience/HVAC-engineer.jpeg';
import photo3 from '../../assets/experience/Mechanical-Engineering.jpg';
import photo4 from '../../assets/experience/Type of Water Distribution Network.jpg';
import { ExperienceContainer } from './experience.styles';

const Experience = () => {
  return (
     <ExperienceContainer>
         <div className="grid-container"> 
         </div>
        <expe1><img src={photo1} alt='freelance-web-developer.jpg' className="img"/></expe1>
        <expe2><img src={photo2} alt='HVAC-engineer.jpeg' className="img"/></expe2>
        <expe3><img src={photo3} alt='Mechanical-Engineering.jpg' className="img"/></expe3>
        <expe4><img src={photo4} alt='Type of Water Distribution Network.jpg' className="img"/></expe4>

     </ExperienceContainer>


    );
  };


export default Experience;
